    <header>
      <p>
      </p>
      header
    </header>
  );
}

const Categoria = (props) =>{
  return(
    <section id="categorias">
      categorias
    </section>
  );
}


const Marca = (props) =>{
  return(
    <section id="Marca">
      Marcas
    </section>
  );
}



const Home = (props)=>{
  return(
    <Layout>
      <Header/>
      <Categoria/>
      <Marca/>
    </Layout>
  );
}

ReactDOM.render(
  <React.StrictMode>
    <Home />
  </React.StrictMode>,
  document.getElementById('root')
);
